{'id': 27490103, 'body': 'Yth. Bapak/Ibu pengguna aplikasi BPJS Ketenagakerjaan, mohon maaf atas ketidaknyamanannya. Perihal kendala gagal simpan foto atau gagal 3 kali verifikasi biometrik saat proses pengkinian data, dapat kami informasikan apabila untuk keperluan klaim dana Jaminan Hari Tua (JHT), kami sarankan Sahabat dapat mengajukan klaim melalui link berikut: https://lapakasik.bpjsketenagakerjaan.go.id atau Service Point Office (SPO) Bank yang bekerja sama dengan BPJS Ketenagakerjaan yaitu Bank BRI, BNI, BJB, BTN dan Mandiri. Namun, jika keperluannya untuk pengkinian data saja, silakan datang ke kantor cabang terdekat dengan membawa dokumen berikut:
1. Kartu Peserta Jamsostek;
2. e-KTP;
3. Kartu Keluarga;
4. Paklaring atau surat keterangan kerja dari perusahaan.
Semua dokumen dibawa asli dan fotokopi. -HR
', 'modified': '2022-01-17T13:47:51Z'}

